query getAimlabLeaderboard($leaderboardInput: LeaderboardInput!) {
  aimlab {
    leaderboard(input: $leaderboardInput) {
      id
      source
      metadata {
        rows
        totalRows
        __typename
      }
      schema {
        id
        fields
        __typename
      }
      data
      __typename
    }
    __typename
  }
}
